    private Symbol s;
    
    public Symbol getS(){
            return this.s;
        }
    /**
     * Mtodo al que se llama automticamente ante algn error sintactico.
    **/ 
    public void syntax_error(Symbol s){
        this.s = s;
        System.out.println("Error Sintctico recuperable en la Lnea " + (s.right + 1) +
        " Columna "+s.left+ ". No se esperaba este componente: " +s.value+".");

        String report = "Syntax error in line " + (getS().right + 1) + " Column " + getS().left + ". No se esperaba este componente: " + getS().value;
        if(getS().value == null){
            report = "You didn't close your last code structure";
        }
        addError(report + "\n");
         
    }

    /**
     * Mtodo al que se llama automticamente ante algn error sintctico 
     * en el que ya no es posible una recuperacin de errores.
     **/ 
    public void unrecovered_syntax_error(Symbol s) throws java.lang.Exception{ 
        System.out.println("Error sntactico irrecuperable en la Lnea " + 
        (s.right)+ " Columna "+s.left+". Componente " + s.value + 
        " no reconocido."); 
    }
    
    //Guardar los errores encontrados
    private String ERRORES = "";
    private int cERRORES = 0;
    public void addError(String error){
        this.ERRORES += error;
       this.cERRORES++;
    }

    public void addMessageErrorOnly(String desc){
        this.ERRORES += desc;
    }
    public String getERRORES(){
        return this.ERRORES;
    }
    public void setERRORES(String err){
        this.ERRORES = err;
    }

    public int getcERRORES(){
        return this.cERRORES;
    }
    public void setcERRORES(int err){
        this.cERRORES = err;
    }

    public String errorMessage(String error, Symbol s){
        //String report = "Syntax error in line " + s.right + " Column " + s.left + ". No se esperaba este componente: " +s.value+ "\nDescripcin: " + error +"\n";
        this.addMessageErrorOnly("Comentario: " + error+"\n");
        System.out.println("Cantidad: " + getcERRORES());
        return "Listo, guapo ;D";
    }

